import React, { FC } from "react";

import ComponentProps from "./types";

const TodoItem = (props: ComponentProps) => {
  return (
    <>
      <div>
        <input type="checkbox" id="scales" name="scales" />
        <label htmlFor="scales">{props.data}</label>
      </div>
    </>
  );
};

export default TodoItem;
